import React from "react";

function Login() {
  return (
    <div className="Login">
      {/*Spotify Logo */}
      {/*Button for spotify login */}
      <img
        src="https://1000logos.net/wp-content/uploads/2017/08/Spotify-symbol.jpg"
        alt="Logo"
      ></img>
      <a>LOGIN WITH SPOTIFY</a>
    </div>
  );
}

export default Login;
